import React from 'react'
import {Link} from "react-router-dom"

const TestData = {
  "lol":[
  {
    "id": 1,
    "testName": "Are you seek?",
    "description": "Yes"
  },
  {
    "id": 3,
    "testName": "Woooooow",
    "description": "Yes"
  },
  {
    "id": 5,
    "testName": "LowKik",
    "description": "Yes"
  }
]}

const questions = TestData.lol.map(item => {
  const res = [];
  res.push(item.id, item.testName)
  return (res);
});

console.log({questions});

let listItems = [];
for (let i of questions) {
    let l = 0;
    for (let k of i) {
        if(l==0){
            listItems.push(<div><input type="text" onChange={(event)=>{this.setState({coinAvalue:event.target.value})}} defaultValue={k}></input></div>)
        }
        else{
            listItems.push(<div><input type="text" onChange={(event)=>{this.setState({coinAvalue:event.target.value})}} defaultValue={k[0]}></input>
            <input type="text" onChange={(event)=>{this.setState({coinAvalue:event.target.value})}} defaultValue={k[1]}></input> </div>)
        }
        l++;
    }
}



export const TestPage = () => {
    return (
      <div className='Content'>
        <div className="Test">
        <div className="GalleryTest">
            <div className="GalleryHeader">
                <h2>Галерея шаблонов</h2>
                <p>Выберите шаблон или нажмите "Начать с нуля",чтобы создать тест</p>
            </div>
            <div className="GalleryBody">
                <p>Все шаблоны</p>
                <p>Психологические</p>
                <p>Логические</p>
                <p>Ассоциативные</p>
            </div>
        </div>
        <div className="TestMain">
            <h1>Создай тест</h1>
            <Link to = '/createtest' style = {{"textDecoration" : "none", "color": "#000 !important"}}>
            <button> + Начать с нуля</button>
            </Link>
            <div className="Tests">
              <img src={'./img/nastroii.jpg'} alt="" className="TestImg" />
              <img src={'./img/vigor.jpg'} alt="" className="TestImg" />
              <img src={'./img/team.jpg'} alt="" className="TestImg" />
            </div>
        </div>
        </div>
      </div>
    )
  }
